import React from "react";
export const AddEmail = (email) => {
  return {
    type: "ADD_EMAIL",
    payload: {
      userEmail: email,
    },
  };
};

export const AddServiceType = (service) => {
  return {
    type: "ADD_SERVICETYPE",
    payload: {
      Service_type: service,
    },
  };
};
